execution.script:
pipeline {
    agent any
    tools{
        maven "MAVEN"
    }

    stages {
        stage('Start SonarQube'){
            agent {label 'target3'}
            steps {
                echo 'SonarQube Start'
                sh '''
                    if sudo docker ps --filter "name=sonarqube" >/dev/null; then
                        sudo docker start sonarqube
                    fi
                '''
            }
        }

        stage('Scan') {
            agent {label 'target3'}
            steps {
                echo 'Scan Start'
                script {
                    withSonarQubeEnv('sonarqube1') {
                        sh "mvn clean compile sonar:sonar"
                    }
                }
            }
        }  

        stage("Quality gate"){
            agent {label 'target3'}
            steps {
                echo 'Quality gate Start'
                waitForQualityGate abortPipeline: true
            }
        }

        stage('Maven Install') {
            agent { label 'target1'}
            steps {
                sh 'mvn clean install'
            }
        }

        stage('Docker Build') {
            agent { label 'target1'}
            steps {
                sh 'sudo docker build -t jpsanchez2024/petclinic:latest .'
            }
        }

        stage('Docker Push') {
    	    agent  { label 'target1'}
            steps {
      	        withCredentials([usernamePassword(credentialsId: 'dockerhub', passwordVariable: 'omar82432024',    usernameVariable: 'jpsanchez2024')]) {
        	          sh "sudo docker login -u 'jpsanchez2024' -p 'omar82432024'"
                    sh 'sudo docker push jpsanchez2024/petclinic:latest'
                }
            }
        }

        stage('Docker Pull') {
            agent { label 'target2'}
            steps {
                sh 'sudo docker pull jpsanchez2024/petclinic:latest' 
            }
        }

        stage('Docker Run') {
            agent { label 'target2'}
            steps {
                // Check for existing container
                sh '''
                    if [ -n "$(sudo docker ps -q)" ]; then
                        sudo docker stop $(sudo docker ps -q)
                    fi
                    '''
                sh 'sudo docker run --rm -d -p 8082:8080 jpsanchez2024/petclinic' 
                sh 'sleep 30'
            }
        }

        stage('Run JMeter Test') {
            agent { label 'target3' }
            steps {
                // Lancement du test JMeter avec le fichier JMX
                script{
                    sh 'cd /opt/apache-jmeter-5.6.3/bin/ && sudo ./jmeter -Jjmeter.save.saveservice.output_format=xml -n -t /opt/apache-jmeter-5.6.3/bin/petclinic.jmx -l /home/azureuser/report_jmeter.jtl'
                }    
            }
        }

        stage('OWASP-ZAP') {
            agent {label 'target3'}
            steps {
                script {
                    sh 'owasp-zap -port 8085 -cmd -quickurl http://52.168.92.118:8082/vets.html -quickprogress -quickout /home/azureuser/report_owasp_zap.xml'
                }
            } 
        }
    }
}
